export enum SIDES {
    LEFT = 'left',
    RIGHT = 'right'
}

export interface ISwitch {
    name: string;
    addr_ipv4: string;
    telnet: string;
    model: string;
    sample_element: string;
    side: SIDES
}

export interface IFloor {
    name: string;
    addr_ipv4?: string;
    telnet?: string;
    model?: string;
    sample_element?: string;
    switches: ISwitch[];
}

export interface IDorm {
    name: string;
    floors: IFloor[]
}
